import { useEffect, useState } from "react";
import { useAppDispatch, useAppSelector } from "../../app/hooks";
import { logout } from "../../services/Auth/AuthSlice";
import './styles.css';
import CarCard from "./CarCard";
import { selectCarList } from "../../services/Car/CarSelectors";

interface PreviousBooking {
Â Â id: number;
Â Â carName: string;
Â Â image: string;
Â Â pickupLocation: string;
Â Â dropoffLocation: string;
Â Â pickupDate: string;
Â Â dropoffDate: string;
Â Â status: 'completed' | 'upcoming' | 'cancelled';
Â Â price: string;
}

interface Review {
Â Â id: number;
Â Â userName: string;
Â Â rating: number;
Â Â comment: string;
Â Â date: string;
Â Â avatar: string;
}

const Dashboard = () => {
Â Â const [activeTime, setActiveTime] = useState('all');
Â Â const [searchInput, setSearchInput] = useState('');
Â Â const [isSearchModalOpen, setIsSearchModalOpen] = useState(false);
Â Â const [showResults, setShowResults] = useState(false);
Â Â const [activeTab, setActiveTab] = useState('all-cars');
Â Â const [isFilterPageOpen, setIsFilterPageOpen] = useState(false);
Â Â const [showLoginPage, setShowLoginPage] = useState(false);
Â Â 

Â Â const { user, isLoading, error } = useAppSelector((state) => state.auth);
Â Â const cars = useAppSelector(selectCarList);
Â Â console.log('Cars:', cars);
Â Â const dispatch = useAppDispatch();

Â Â // Function to render stars based on rating
Â Â const renderStars = (rating: number) => {
Â Â Â Â const stars = [];
Â Â Â Â for (let i = 1; i <= 5; i++) {
Â Â Â Â Â Â stars.push(
Â Â Â Â Â Â Â Â <span key={i} className={`star ${i <= rating ? 'filled' : 'empty'}`}>
Â Â Â Â Â Â Â Â Â Â {i <= rating ? 'â˜…' : 'â˜†'}
Â Â Â Â Â Â Â Â </span>
Â Â Â Â Â Â );
Â Â Â Â }
Â Â Â Â return stars;
Â Â };

Â Â // Helper function to format date strings
Â Â const formatDate = (dateString: string) => {
Â Â Â Â const options: Intl.DateTimeFormatOptions = { year: 'numeric', month: 'short', day: 'numeric' };
Â Â Â Â return new Date(dateString).toLocaleDateString('en-US', options);
Â Â };

Â Â const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
